import { useEffect, useState } from "react";
import NavBar from "../Component/NavBar";

function SearchBreed() {
  const [dogs, setDogs] = useState([]);
  const [error, setError] = useState(null)

  useEffect(() => {
    const fetchBreed = async () => {
      try {
        const res = await fetch("https://api.thedogapi.com/v1/breeds?limit=12", { //limit to 21 images populated
            method: "GET",
            headers: {
              "Content-Type": "application/json",
              "x-api-key":
                "live_Xv1NIDcHuYJfH9CnI39Kwmzb0AV6tkxTCQSmsLIaP60jsnCvV9X0T8NZc5Zbl1ak",
            },
          }
        );
        const data = await res.json();
        setDogs(data);
      } catch (error) {
        setError(error)
        // console.log(error);
      }
    };
    fetchBreed();
  }, []);

  if(error){
    <p>An error occured: {}</p>
  }

  return (
    <div>
      <NavBar></NavBar>
      <div className="container" id="container">
        <h1 className="search-title">Welcome to the dog World</h1>
        <div className="searchbar-border">
          <input
            className="search-bar"
            type="text"
            placeholder="Search for a dog breed"
          ></input>
        </div>

        <div className="grid grid: cols-1 md:grid-cols-2 lg:grid-cols-3 gap-16 my-12 p-8 text-white">
          {dogs.map((dog) => (
            <article
              className="dog-card-color p-4 rounded px-0 pt-0"
              key={dog.id}
            >
              <img
                className="rounded md:h-72 w-full object-cover"
                src={dog.image.url}
                key={dog.image.id}
              ></img>
              <h3 className="font-bold mt-6">{dog.name}</h3>
              <p>{dog.bred_for}</p>
            </article>
          ))}
        </div>
      </div>
    </div>
  );
}

export default SearchBreed;
